package github.leetcode.有效的字母异位词;

import java.util.HashMap;

/**
 * Created by hujingtian on 2019/10/22.
 */
public class Anagram {

   String s =  "";
   String t =   "";

   public static void main(String[] args){
       Anagram anagram = new Anagram();
       anagram.isAnagram(anagram.s,anagram.t);
   }
    public boolean isAnagram(String s, String t) {
        if(s.length() != t.length()){
            return false;
        }
        HashMap<Character,Integer> shash = new HashMap();
        HashMap<Character,Integer> thash = new HashMap();
        char[] schar = s.toCharArray();
        char[] tchar = t.toCharArray();
        for(char sc : schar){
            shash.put(sc,shash.getOrDefault(sc,0)+1);
        }
        for (char tc : tchar){
            thash.put(tc,thash.getOrDefault(tc,0)+1);
        }
        for(char key : shash.keySet()){
            if(! shash.get(key).equals(thash.get(key))){
                return false;
            }
        }
        return true;
    }
}
